Here is my attempt at drawing a line and a guitar in Processing without using any transformations:

```processing
void setup() {
  size(400, 400);
  stroke(0);
  strokeWeight(3);
}

void draw() {
  // Draw the line at the top
  line(0, 30, width, 30);

  // Draw the guitar body
  noStroke();
  fill(200, 100, 0);
  quad(50, 100, 150, 100, 200, 150, 100, 150);

  // Draw the guitar neck
  stroke(0);
  line(150, 100, 150, 30);

  // Draw the tuning pegs
  stroke(0);
  line(140, 30, 150, 30);
  line(160, 30, 170, 30);

  // Draw the frets
  for (int i = 0; i < 5; i++) {
    line(150, 30 + i * 20, 170, 30 + i * 20);
  }

  // Draw the bridge
  stroke(0);
  line(50, 150, 70, 150);
  line(80, 150, 100, 150);

  // Draw the pickguard
  noStroke();
  fill(255);
  quad(60, 120, 90, 120, 110, 140, 80, 140);

  // Draw the sound hole
  ellipse(125, 125, 50, 50);

  // Draw the strings
  for (int i = 30; i < 150; i += 20) {
    line(50, i, 200, i);
  }
}
```

This draws a horizontal line at the top, then proceeds to draw the various parts of the guitar without using any transformations:

- The guitar body 
- The neck 
- The tuning pegs
- The frets
- The bridge 
- The pickguard
- The sound hole
- The strings

By combining all these individual parts, a full guitar image is created. Let me know if you would like me to explain or clarify any part of this code.

