Here is my attempt at drawing a line and fountain in Processing without using any transformations:

```processing
void setup() {
  size(400, 400);
  stroke(0);
  strokeWeight(2);
}

void draw() {
  background(255);

  // Draw the top line
  line(0, 50, width, 50);

  // Draw the base of the fountain
  noStroke();
  fill(150);
  ellipse(width/2, height/2, 200, 200);

  // Draw the first level of the fountain
  fill(0);
  ellipse(width/2, height/2-50, 150, 150);

  // Draw the second level of the fountain
  fill(0);
  ellipse(width/2, height/2-100, 100, 100);

  // Draw the third level of the fountain
  fill(0);
  ellipse(width/2, height/2-150, 50, 50);

  // Draw the water
  noFill();
  stroke(0);
  strokeWeight(1);
  beginShape();
  vertex(width/2-50, height/2-50);
  vertex(width/2-25, height/2-75);
  vertex(width/2, height/2-100);
  vertex(width/2+25, height/2-75);
  vertex(width/2+50, height/2-50);
  endShape();

  // Draw the water droplets
  stroke(255);
  point(width/2-10, height/2-60);
  point(width/2+10, height/2-60);
  point(width/2-20, height/2-80);
  point(width/2+20, height/2-80);
  point(width/2-30, height/2-90);
  point(width/2+30, height/2-90);
}
```

This draws:

- A line at the top 
- A base ellipse for the fountain 
- Three concentric ellipses for the levels of the fountain
- A shape to represent the water 
- White points to represent water droplets

