Here is my attempt at drawing a line and a house in Processing without using any transformation functions:

```processing
void setup() {
  size(400, 400);  // Set canvas size
}

void draw() {
  background(255); // Set background to white

  // Draw the line at the top
  stroke(0);      // Set line color to black
  strokeWeight(5); // Set line thickness to 5 pixels
  line(0, 30, width, 30);  

  // Draw the house

