```processing
void setup() {
  size(400, 400);  // Set canvas size
}

void draw() {
  background(255);  // Set background to white

  // Draw the line at the top
  stroke(0);  // Set line color to black
  line(0, 30, width, 30);  

  // Draw the palm tree trunk 
  stroke(150, 75, 0);  // Set trunk color to brown
  line(width/2, 30, width/2, 120);  

  // Draw the palm leaves
  noStroke();  // Disable stroke
  fill(0, 100, 0);  // Set leaf color to dark green

  // Left leaf
  beginShape();
  vertex(width/2 - 80, 120);
  vertex(width/2 - 100, 140);
  vertex(width/2 - 60, 160);
  vertex(width/2 - 80, 180);
  vertex(width/2 - 60, 160);
  vertex(width/2 - 80, 120);
  endShape(CLOSE);

  // Middle leaf
  beginShape();
  vertex(width/2 - 40, 120);
  vertex(width/2 - 60, 140);
  vertex(width/2 - 20, 160);
  vertex(width/2 - 40, 180);
  vertex(width/2 - 20, 160);
  vertex(width/2 - 40, 120);
  endShape(CLOSE);

  // Right leaf
  beginShape();
  vertex(width/2, 120);
  vertex(width/2 - 20, 140);
  vertex(width/2 + 20, 160);
  vertex(width/2, 180);
  vertex(width/2 + 20, 160);
  vertex(width/2, 120);
  endShape(CLOSE);  
}
```

